import React from "react";
import styled from "styled-components";

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
`
const Logo = styled.img`
    width: 15em;

`;

const Login = () => {
    return (
        <div >
            <Container>
                <Logo src="/chackcheck.png"/>
            </Container>
        </div>
    );
}

export default Login;
